import React from 'react';
class Task2 extends React.Component{
    render(){
        return(
            <div>
                <p>Item1</p>
                <p>"Item2"</p>
                <p>"Item3"</p>
                <p>"Item4"</p>
            </div>
        )
    }
}
export default Task2;
